import { StyleSheet} from 'react-native';
const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: 'white',
    },
  });

const stylesHeader = StyleSheet.create({
    containerHeader: {
        flex: 1,
        flexDirection: 'row',
        backgroundColor: '#1a1717',
        borderBottomColor: '#c75252',
        borderBottomWidth: 2,
    },
    headerNavbarBrand: {
        flex: 1,
        justifyContent: 'center', 
        alignItems: 'center', 
    },
    headerNavbarRight: {
        flex: 1,
        justifyContent: 'center', 
        alignItems: 'center', 
        flexDirection: 'row',
    },
    navbarLogo: {
        color: 'white',
        fontSize: 22,
    },
  });

  const stylesMain = StyleSheet.create({
    containerMain: {
        flex: 9,
        backgroundColor: 'white',
    },
  });
  
  export {styles, stylesHeader, stylesMain};
